import ReactDOM from 'react-dom';
import './index.css';

function Card(props){
  console.log(props);
  return (
    <>
    <div className="cards">
      <div className="card">
        <img src="" alt="myPic" className="card_img" />
        <div className="card__info">
          <span className="card__category">   </span>
          <h3 className="card__title"></h3>
          <a href="" target="_blank"></a>
          <button>Watch Now</button>
        </div>

      </div>

    </div>
    {/* <input type="text" value="Hitesh" /> */}
  </>
  )
}

ReactDOM.render(
<>
<Card  imgsrc="https://wallpapercave.com/wp/wp4056410.jpg" title="A Netflix Orignal Series" 
  sname="'DARK" link="https://www.netflix.com/in/title/80990668?source=35"
/>
<Card />
<Card />
</>, document.getElementById('root'))
